import React, { Component } from 'react'
import axios from 'axios'
import CircularProgress from '@material-ui/core/CircularProgress';

import Grid from "@material-ui/core/Grid";
import Paper from '@material-ui/core/Paper';


export class Handler extends Component {

    constructor(props) {
        super(props);

        this.state = {
            lvl: props.lvl,
            row : [],
            columns : [],
            seen: false,
            selectedRowID: -1,
        }
    }

    renderSwitch(param) {

        switch (param) {
            case 'Level 2':
                return(
                <div>lvl2</div>
                    );
            case 'Level 3':
                return(
                    <div>lvl3</div>
                        );
            default:
                return(
                    <div>lvl1</div>
                        );
        }
    }


    render() {
        if(!this.state.seen){
        return (
            <div>
             <Grid
          container
          direction="row"
          spacing={24}
          alignItems="flex-end"
          justify = "center"
          style={{
            color: "orange",
            width: "100%",
            height: "100%",
            flexGrow: 1
          }}>  
        <Grid item  sm={3}>
            <Paper sm={3} />
          </Grid>
          <Grid item  sm={6} >
            <CircularProgress disableShrink size={90} sm={6}/>
          </Grid>
          <Grid item sm={3}>
            <Paper sm={3}/>
          </Grid>
        </Grid>
            </div>
        );
        }
        else{
            return (
            <div>
                {this.renderSwitch(this.state.lvl)}
                hello    
            </div>
        )
            }
    }

    componentDidMount(){
        if(!this.state.seen){
            axios.post('http://localhost:8080/1729197/logus?user=' + this.state.userName + '&' + 'password=' + this.state.passWord, {
             })
                .then((response) => {
                    console.log("----------------------------------",response);
            }
            )
        }
    }
}

export default Handler
